import React, { useState } from 'react';

const Slidehome = () => {
    const [firstName, setFirstName] = useState('');





    return (
        <>

            <input
                type="text"
                name="firstName"
                onChange={(event) => event * 10000} />
        </>

    );
}

export default Slidehome;
